import React from "react";
import Post from "./Post";
import Loader from "./Loader";

const PostsList = posts => {
  return (
    <div>
      {posts.posts ? (
        <ul>
          {posts.posts.map(post => (
            <Post key={post.title + new Date()} />
          ))}
        </ul>
      ) : (
        <Loader />
      )}
    </div>
  );
};

export default PostsList;
